import React from 'react';
import SearchTrails from './searchTrails'
import { Routes, Route, Link } from 'react-router-dom';


function Home() {
  return (
    <Router>
    <div>
    <h1>Welcome to the Home Page</h1>
     <Routes>
     <Route path="/search-trails" element={<SearchTrails />} />
    </Routes>
    </div>
    </Router>
  );
}

export default Home;
